import { AppBar, Button, Container, Grid, Paper, TextField, Typography } from '@mui/material'
import { borderRadius, Box, color, maxWidth } from '@mui/system'
import { styled } from '@mui/material/styles';
import React from 'react'
import Logo from './Logo.ico'





// Custom Textbox
const CTextField = styled(TextField)({

 
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: '#9B3C21',
      },
      '&:hover fieldset': {
        borderColor: '#9B3C21',
      },
  
    },
  });
  

const Login = () => {
  return (
    <div>
         <Grid container spacing={2} padding={2} style={{minHeight:'40vh'}}                 
         direction="column"
         justifyContent="center"
                alignItems="center">
{/* Logo Column */}
            <Grid item xs={12} sm={12} md = {6} lg={6} zeroMinWidth >

            <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center"
                >



                 <img src={Logo} alt='Logo' style={{objectFit:'cover'}}/>
                
            </Grid>

</Grid>

{/* Login Column */}
            <Grid item xs={12} sm={12} md = {6} lg={6} zeroMinWidth >
  

            <Grid container
                direction="column"
                justifyContent="flex-end"
                alignItems="center"
               >
                    

                    <Grid
            // CSS codingzeroMinWidth
                        Container
                        padding={2}
                        style={{
                            backgroundColor:'white',
                            minHeight:'200',
                            borderRadius: 5,

                            border:'3px solid black'}}>

                                  <AppBar position="static">asdads</AppBar>

                                <CTextField label= 'asds' placeholder='asdasd' fullWidth margin='dense'/>
                                <CTextField label= 'asds' placeholder='asdasd' fullWidth margin='dense'/>
                                <a href=''>asdasdasd</a>
                                <br/>
                                <Button>Login</Button>
                        
                    </Grid>
              
                
            </Grid>








                 
            </Grid>
                
            
         
         </Grid>
         
         
    </div>
  )
}

export default Login
